    const { id, name, label } = filterByPriceItem;
    console.log('name', name);
    return ( <
        FilerByPriceItems >
        <
        Input type = "radio"
        name = "filterByPrice"
        value = { id }
        nameLabel = { name }
        id = { label }
        onChange = { onChange }
        /> < /
        FilerByPriceItems >
    );
}
export default FilerByPriceItem;
